    false,nt"url": null,nt"notes": "Appendix A contains the data which met
    QA/QC criteria. Concentrations (ppm) for each element are individually tabulated.
    Values for sediment, total waters, recoverable waters, and dissolved waters are
    listed by site for each year. The tables are ordered alphabetically by element.
    Appendix B contains graphs of the data from Appendix A. The graphs show sample concentrations
    (ppm) and median values for the elements in sediment, total waters, and dissolved
    waters at the six different sites. Each graph shows a range of values for those
    years in which data was available. Only concentrations that were reliable (i.e.
    concentrations in dissolved waters that are higher than those in total waters are
    not reliable) and were above the laboratory's limit of detection are included in
    the graphs. The graphs are listed alphabetically by element. Appendix C contains
    general water quality measurements of turbidity, hardness, total suspended solids,
    and temperature for each of the sites. Hardness measurements for 1989-90 were not
    considered reliable and are not included. Total suspended solids were only measured
    in 1988.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
